import React from "react";
import HighlightIcon from "@material-ui/icons/Highlight";
import { Navbar, Nav } from "react-bootstrap";


function Header (){

    return (
        // <header>
        //   <h1>
        //     <HighlightIcon />
        //     Michael Powell
        //   </h1>
        // </header>

        <Navbar>
        <Navbar.Brand>
            Scratch
        </Navbar.Brand>
        <Nav>
          <Nav.Item>
              Lookup
          </Nav.Item>
          <Nav.Item>
              List
          </Nav.Item>
        </Nav>
      </Navbar>
      );
}

export default Header;
